import sys

class fenwick():

    def __init__(self, n):
        self.n = n
        self.data = [0]*(n+1)

    def to_sum(self, i):

        s = 0
        while i > 0:
            s += self.data[i]
            i -= (i & -i)
        return s

    def add(self, i, x):

        while i <= self.n:
            self.data[i] += x
            i += (i & -i)

    def get(self, i, j):

        return self.to_sum(j)-self.to_sum(i-1)

