        if t-1 not in Out[t-1]:
            flag = False
            break
        else:
            Out[t-1].remove(t-1)
            In[t-1].remove(t-1)

    T = topological_sort(In, Out)
    if flag and T:
        print('YES')
        print(*[t+1 for t in T])
    else:
        print('NO')

