class Solution(object):
    def beautifulSplits(self, nums):
        def z_function(s): 
            z = [0]*len(s)
            l, r = 0, 0
            for i in range(1, len(z)):
                if i <= r:
                    z[i] = min(r-i+1, z[i-l])
                while i+z[i] < len(z) and s[z[i]] == s[i+z[i]]:
                    z[i] += 1
                if i+z[i]-1 > r:
                    l, r = i, i+z[i]-1
            return z

        result = 0
        z0 = z_function(nums)
        for i in range(1, len(nums)-1):
            zi = z_function(nums[i:])
            for j in range(i+1, len(nums)):
                if (z0[i] >= i and j-i >= i) or zi[j-i] >= j-i:
                    result += 1
        return result,O(n ^ 2)

def solve(n, k):

	if n >= 60:
		return "YES " + str(n - 1)

	mxxx = (4 ** n - 1) // 3

	if k > mxxx:
		return 'NO'

	mn, mx = 0, 0

	for i in range(n):
		mn += 2 ** (i + 1) - 1
		mx += 4 ** i
		if mn <= k and mx >= k:
			return "YES " + str(n - i - 1)

	if k >= 22 and k <= 25:
		return 'YES ' + str(n - 3)

	if k == 2:
		if n >= 2:
			return 'YES ' + str(n - 1)
		return 'NO'

	if k == 3:
		if n <= 2:
			return 'NO'
		return 'YES ' + str(n - 1)

	if k >= 6 and k <= 10:
		return 'YES ' + str(n - 2)

